 let handleSubmit = e => {
    e.preventDefault();
    const formData = {
      method: 'GET',
      url: 'https://pokeapi.co/api/v2/pokemon',
    };
    this.props.handleApiCall(formData);
  }
  return (
    <>
      <form onSubmit={this.handleSubmit}>
        <label >
          <span>URL: </span>
